description:
@12pm

Open field on rt, just past lower parking lot, where road crosses creek.
Animal unconcerned about presence of humans

@10am
Open field on rt. after point where road crosses creek, after lower parking lot.

Herpetologist was shading it from sun during observation period

Near where park road crosses over creek, approximately 300 yards after passing lower parking lot.
@11am

Please note the person holding the animal is a professional, and permitted herpetologist. Animal released immediately thereafter.
